import { Container, Navbar, Nav } from "react-bootstrap";
import logo from './logo.png';
import telegram from './telegram.png';
import budilnik from './budilnik.png';
import { useContext } from "react";
import { AuthContext } from "../context/AuthContext";

const Header = () => {
  const { authenticated } = useContext(AuthContext);

  return (
    <>
      <Navbar style={{ height: '100px', backgroundColor: '#BE95C4', boxShadow: '0px 2px 0px', zIndex: "7" }}>
        <Container bg="#BE95C4">
          <Navbar.Brand href={authenticated ? "/Main" : "/"} style={{ position: 'absolute', top: 0, left: 0 }}>
            <img
              src={logo}
              height="100%"
              className="d-inline-block align-top"
              alt="logo"
              style={{ left: "0" }}
            />
          </Navbar.Brand>
          <Nav className="ms-auto d-flex flex-row-reverse" style={{ fontSize: "1vw" }}>
            <Nav.Link href="/" className="nav-link-with-icon">
              <img src={telegram} className="nav-link-icon" alt="Telegram" />
              Telegram
            </Nav.Link>
            <Nav.Link href="/" className="nav-link-with-icon">
              <img src={budilnik} className="nav-link-icon" alt="Set Notifications" />
              Set Notifications
            </Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </>
  );
};

export default Header;
